import React from "react";
import { Helmet } from "react-helmet";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Visualizer from "./Visualizer/Visualizer";

const App: React.FC = () => {
  return (
    <div>
      <Helmet>
        <title>Pathfinding Visualizer</title>
        <meta name="description" content="React-rat Pathfinding visualizer" />
        <link rel="shortcut icon" href="../icon/favicon.ico" />
        <link rel="manifest" href="../icon/site.webmanifest"></link>
      </Helmet>
      <Router>
        <Switch>
          <Route exact path="/pathfinding-visualizer" component={Visualizer} />
          {/* <Route path="/react-rat" component={ReactRat} /> */}
        </Switch>
      </Router>
    </div>
  );
};

export default App;
